
public class checkEveryEightmer {
	//public static String L1 = "";
	//public static String L1 = "";
	//public static String L1 = "------------------";
	
	//re-arranged
	//public static String L1 = "";
	
	//original
	//public static String L1 = "";
	
	public static String L1 = "";
	public static int length_of_subseq = 7;//the run of bases to be checked for commonality
	public static String [] common_sub = new String[L1.length()];	
	public static String [] unique_common_sub = new String [L1.length()];
	public static int found_index=0;
	public static int unique_count=0;
	
	public static void main(String[] args) { 
//		L1 = L1+final_seq;
		for (int i=0;i<(L1.length()-length_of_subseq);i=i+length_of_subseq){
			String current = L1.substring(i, i+length_of_subseq);
			//System.out.println("\n\ncurrent: "+current+"  compared to : ");
			for (int j=i+8;j<(L1.length()-length_of_subseq)+1;j=j+length_of_subseq){	
				//System.out.println(L1.subSequence(j, j+length_of_subseq));
				if(current.equals(L1.subSequence(j, j+length_of_subseq))){
					common_sub[found_index]= (String)L1.subSequence(j, j+length_of_subseq);
					found_index++;
				}
			}
		}
		
		
		System.out.println("\n\nALL:"+found_index);
		for(int x=0;x<found_index;x++){
			System.out.print("\n"+x+": "+common_sub[x]);
		}
		removeDuplicates(found_index);
		System.out.println("\n\nUNIQUE:"+unique_count);
		for(int x=0;x<unique_count;x++){
			System.out.print("\n"+x+": "+unique_common_sub[x]);
		}
		System.out.println("\n\ndone,  \nAll \t\t"+found_index+"\nUnique \t\t"+unique_count+"\nstring_length \t"+L1.length());
	}
	public static void removeDuplicates (int found_index){
		String current;		
		int flag = 0;
		for (int i=0;i<found_index;i++){
			current = common_sub[i];
			for (int j=i+1;j<found_index;j++){
				if (current.equals(common_sub[j]))
					flag = 1;
			}
			if(flag == 0){				
				unique_common_sub [unique_count] = current;
				unique_count++;			
			}else
				flag =0;
		}
	}
}
